function init2DLine(color) {//add 添加线
	var model = new Model({
		Size: [0,0.1,0.1],
		Position: [0, -1.4, 0],
		Rotation: [0,0,0],
		Direction: [-1,0,-1],
		onGround: true,
		hasShadow: false,
		Selectable: false,
		V:0,
		LastPosition: [0,-0.4,0],
		KeyFrames: [],
		KeyPos: 0
	});
	var points=[vec4(-1,-1,-1),vec4(-1,1,-1),vec4(-1,1,1),vec4(-1,1,1),vec4(-1,-1,1),vec4(-1,-1,-1),
	vec4(1,-1,-1),vec4(1,1,-1),vec4(1,1,1),vec4(1,1,1),vec4(1,-1,1),vec4(1,-1,-1),
	vec4(-1,-1,-1),vec4(1,-1,-1),vec4(1,-1,1),vec4(1,-1,1),vec4(-1,-1,1),vec4(-1,-1,-1),
	vec4(-1,1,-1),vec4(1,1,-1),vec4(1,1,1),vec4(1,1,1),vec4(-1,1,1),vec4(-1,1,-1),
	vec4(-1,-1,-1),vec4(1,-1,-1),vec4(1,1,-1),vec4(1,1,-1),vec4(-1,1,-1),vec4(-1,-1,-1),
	vec4(-1,-1,1),vec4(1,-1,1),vec4(1,1,1),vec4(1,1,1),vec4(-1,1,1),vec4(-1,-1,1)];
	//var color=vec4(1,1,1);
	var colors = Array(points.length).fill(color);
	model.pointBuffer = gl.createBuffer();
	model.normalBuffer = gl.createBuffer();
	model.pointsNumber = points.length;
	gl.bindBuffer(gl.ARRAY_BUFFER, model.pointBuffer);
	gl.bufferData(gl.ARRAY_BUFFER, flatten(points), gl.STATIC_DRAW);
	gl.bindBuffer(gl.ARRAY_BUFFER, model.normalBuffer);
	gl.bufferData(gl.ARRAY_BUFFER, flatten(colors), gl.STATIC_DRAW);
	model.isParsed=true;
	return model;
}

function prepareLine(){//add 预加载线
	var ex_time=parseMap(omr_expert_map);
	var i=0;
	while(1){
		//models['L'+i]=init2DLine(vec4(1,1,1));
		models['L'+i]=init2DLine(vec4(Math.random(),Math.random(),Math.random()));
		models['L'+i].KeyFrames=[ex_time[i]];
		models['L'+i].Printable=false;
		models['L'+i].update=function (){
			var nowTime=(Date.now()-world.startTime)/1000;
			if (nowTime>model.KeyFrames[model.KeyPos]){
				model.Printable=true;
				model.V=14;
				model.KeyPos=model.KeyPos+1;
				model.Position[0]=models['auto_cube'].Position[0];
				model.Position[1]=-1;
				model.Position[2]=models['auto_cube'].Position[2];
				//console.log('时间：'+world.gameTime+'线'+' 位置'+model.Position)
			}
			model.Size[0]=model.V*((nowTime-model.KeyFrames[0]));
			if (nowTime>model.KeyFrames[0]+15){
				model.Printable=false;
				requestAnimationFrame(function (){delete models['L'+i];});
			}
		}
		i=i+1;
		//if(ex_time[i]>15.104895104895107)
			//break;
		
		if(ex_time[i]==undefined)break;
	}
	return i;

}